import { Link, NavLink } from "react-router-dom";
import lcLogo from "../../assets/images/lightCubeLogo.png";
import { sideIcons, sideLinks } from "../../Constants";

const Sidebar = () => {
  return (
    <div className="flex flex-col items-center justify-between w-14 h-screen fixed left-0 p-3">
      <Link className="logo" to="/">
        <img src={lcLogo} alt="logo" className="w-full" />
      </Link>
      <nav className="grid gap-y-4">
        {sideIcons.map((item, index) => (
          <NavLink
            exact
            activeclassname="active"
            className="text-2xl flex-fullcenter relative"
            key={index}
            to={item.path}
          >
            <i className={`fa-duotone ${item.icon}`}></i>
            <span className="absolute left-[-100%] w-full text-center text-xs text-slate-50">
              {item.label}
            </span>
          </NavLink>
        ))}
      </nav>
      <ul className="flex flex-col items-center">
        {sideLinks.map((item, index) => (
          <li key={index}>
            <a target="_blank" rel="noreferrer" href={item.link}>
              <i className={`fab ${item.icon}`}></i>
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
